import React from "react";
import { motion } from "framer-motion";
import "../styles/Projects.css";

// Your GitHub Projects List with stable images
const projects = [
  {
    title: "ML Practicles",
    description: "Machine learning practice codes and implementations.",
    image: "https://via.placeholder.com/600x400.png?text=ML+Practicles",
    link: "https://github.com/anmol8070/ML_Practicles",
  },
  {
    title: "NeoCampus",
    description: "Campus management system built with HTML & JS.",
    image: "https://via.placeholder.com/600x400.png?text=NeoCampus",
    link: "https://github.com/anmol8070/NeoCampus",
  },
  {
    title: "CET Admission Buddy",
    description: "Predicts college eligibility based on CET scores.",
    image: "https://via.placeholder.com/600x400.png?text=CET+Admission+Buddy",
    link: "https://github.com/anmol8070/CET-Admission-Buddy",
  },
  {
    title: "Blood Group App",
    description: "Blood group finder built with Python.",
    image: "https://via.placeholder.com/600x400.png?text=Blood+Group+App",
    link: "https://github.com/anmol8070/bloodgroup_app",
  },
  {
    title: "Form Filling Android",
    description: "Android app for automated form filling.",
    image: "https://via.placeholder.com/600x400.png?text=Form+Filling+Android",
    link: "https://github.com/anmol8070/Form-Filling-Android",
  },
  {
    title: "Form Builder",
    description: "Custom form builder with JavaScript.",
    image: "https://via.placeholder.com/600x400.png?text=Form+Builder",
    link: "https://github.com/anmol8070/Form-Builder",
  },
  {
    title: "Infosys Project Work",
    description: "Infosys-based Objective-C project work.",
    image: "https://via.placeholder.com/600x400.png?text=Infosys+Project+Work",
    link: "https://github.com/anmol8070/Infosys-Project-Work",
  },
  {
    title: "Anti Drowsy System",
    description: "AI-based driver drowsiness detection.",
    image: "https://via.placeholder.com/600x400.png?text=Anti+Drowsy+System",
    link: "https://github.com/anmol8070/AntiDrowsySystem",
  },
  {
    title: "Phone Cost Predictor",
    description: "Mobile price classification with ML.",
    image: "https://via.placeholder.com/600x400.png?text=Phone+Cost+Predictor",
    link: "https://github.com/anmol8070/PhoneCost-Predictor",
  },
  {
    title: "Blinkit Commerce Insights",
    description: "Analytics project for Blinkit.",
    image: "https://via.placeholder.com/600x400.png?text=Blinkit+Commerce+Insights",
    link: "https://github.com/anmol8070/Blinkit-Commerce-insights",
  },
  {
    title: "Gen Secure Password",
    description: "Password generator with customizable options.",
    image: "https://via.placeholder.com/600x400.png?text=Gen+Secure+Password",
    link: "https://github.com/anmol8070/GenSecurePassword",
  },
  {
    title: "Plan Craft",
    description: "Guest & event management system.",
    image: "https://via.placeholder.com/600x400.png?text=Plan+Craft",
    link: "https://github.com/anmol8070/Plan-Craft",
  },
  {
    title: "Jarvis AI Assistance",
    description: "Personal AI assistant built with Python.",
    image: "https://via.placeholder.com/600x400.png?text=Jarvis+AI+Assistance",
    link: "https://github.com/anmol8070/Jarvis-Ai-Assistance",
  },
];

export default function Projects() {
  return (
    <section id="projects" className="projects">
      <h2 className="section-title">🚀 Featured Projects</h2>

      <div className="projects-grid">
        {projects.map((proj, index) => (
          <motion.div
            key={index}
            className="project-card"
            whileHover={{ scale: 1.05 }}
            transition={{ duration: 0.3 }}
          >
            <img src={proj.image} alt={proj.title} className="project-img" />
            <div className="project-content">
              <h3>{proj.title}</h3>
              <p>{proj.description}</p>
              <a href={proj.link} target="_blank" rel="noreferrer">
                🔗 View on GitHub
              </a>
            </div>
          </motion.div>
        ))}
      </div>
    </section>
  );
}
